import Nav from './header';
import styled from 'styled-components';

const Layout = ({ children }) => {
    return (
        <>
            <Nav />
            <Container className="global-inner">
                {children}
            </Container>
        </>
    )
}

export default Layout;

const Container = styled.div`
    margin:2em auto 5em;
`
